  // implement bimodal
  template<int SIZE>
  struct Bimodal{
    // 4 entries per 8 bits, 2 bits saturator
    std::array<std::uint8_t, (SIZE>>2)> data;
    std::uint64_t h = 0;

    Bimodal(){
      data.fill(0);
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      // gets the sub index in the data itself iykwim
      std::uint8_t val = (data[h>>2]&(0b11<<((h&0x03)<<1)))>>((h&0x03)<<1);
      if((val>>1)%2){
        return true;
      } else return false;
    }


    void update(bool outcome){
      std::uint8_t val = (data[h>>2]&(0b11<<((h&0x03)<<1)))>>((h&0x03)<<1);
      data[h>>2] &= ~(0b11<<((h&0x03)<<1));
      data[h>>2] |= ((outcome) ? std::min(3, val+1) : std::max(0, val-1))<<((h&0x03)<<1);
    }
  }; 

  // implement bimodal
  template<int SIZE>
  struct Bimodal3bit{
    // 4 entries per 8 bits, 2 bits saturator
    std::array<std::uint8_t, (SIZE>>1)> data;
    std::uint64_t h = 0;

    Bimodal3bit(){
      data.fill(0);
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      // gets the sub index in the data itself iykwim
      std::uint8_t val = (data[h>>1]&(0b111<<((h&0b1)<<2)))>>((h&0x01)<<2);
      if((val>>2)%2){
        return true;
      } else return false;
    }


    void update(bool outcome){
      std::uint8_t val = (data[h>>1]&(0b111<<((h&0b1)<<2)))>>((h&0x01)<<2);
      data[h>>1] &= ~(0b111<<((h&0b1)<<2));
      data[h>>1] |= ((outcome) ? std::min(7, val+1) : std::max(0, val-1))<<((h&0b1)<<2);
    }
  };

  // implement bimodal
  template<int SIZE>
  struct Bimodal4bit{
    // 4 entries per 8 bits, 2 bits saturator
    std::array<std::uint8_t, (SIZE>>1)> data;
    std::uint64_t h = 0;

    Bimodal4bit(){
      data.fill(0);
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      // gets the sub index in the data itself iykwim
      std::uint8_t val = (data[h>>1]&(0xF<<((h&0b1)<<2)))>>((h&0x01)<<2);
      if((val>>3)%2){
        return true;
      } else return false;
    }


    void update(bool outcome){
      std::uint8_t val = (data[h>>1]&(0xF<<((h&0b1)<<2)))>>((h&0x01)<<2);
      data[h>>1] &= ~(0xF<<((h&0b1)<<2));
      data[h>>1] |= ((outcome) ? std::min(15, val+1) : std::max(0, val-1))<<((h&0b1)<<2);
    }
  };


  // TAGE table history 8
  struct Table8{
    // 12 bit tag, 2 bit saturator, 2 bit usefulness
    std::array<uint16_t, 8192> data;
    std::uint8_t hist = 0;
    std::uint16_t phr = 0;

    Table8(){
      data.fill(0);
    }

    std::uint16_t getIdx(std::uint64_t hashid){
      return ((hist)^(hashid%8192)^phr^(phr>>13))&0x1FFF;
    }

    std::uint16_t gen_tag(std::uint64_t hashid){
      return ((hist)^(hashid%4096))&0x0FFF;
    }

    std::uint16_t fetch_tag(std::uint64_t hashid){
      return data[getIdx(hashid)];
    }

    // gets the saturator and confidence
    std::uint8_t get(std::uint64_t hashid){
      std::uint16_t store = fetch_tag(hashid);
      std::uint16_t real = gen_tag(hashid);
      if(store==real){
        return data[getIdx(hashid)]&0xF;
        //if((data[getIdx(hashid)] >> 3)%2){
        //  return true;
        //} else {
        //  return false;
        //}
      }
      return 0b11111111;
    }


    std::uint8_t getU(std::uint64_t hashid){
      return data[getIdx(hashid)]&0x3;
    }
    std::uint8_t getS(std::uint64_t hashid){
      return (data[getIdx(hashid)]&0xC)>>2;
    }
 
    void changeU(bool positive, std::uint64_t hashid){
      std::uint16_t idx = getIdx(hashid);
      std::uint8_t val = data[idx]&0x3;
      data[idx] &= ~0x3;
      data[idx] |= (positive) ? std::min(3,val+1) : std::max(0, val-1);
    }

    void changeS(bool positive, std::uint64_t hashid){
      std::uint16_t idx = getIdx(hashid);
      std::uint8_t val = data[idx]&0xC;
      data[idx] &= ~0xC;
      data[idx] |= ((positive) ? std::min(3,val+1) : std::max(0, val-1))<<2;
    }

    void histupdate(bool outcome, std::uint64_t planetid){
      hist <<= 1; hist |= outcome;
      phr <<= 1; phr |= planetid&1;
    }
  };

  // TAGE table history 32
  struct Table32{
    // 12 bit tag, 2 bit saturator, 2 bit usefulness
    std::array<uint16_t, 16384> data;
    std::uint32_t hist = 0;
    std::uint16_t hist14 = 0;
    std::uint16_t hist12 = 0;
    std::uint16_t hist11 = 0; // CSR2
    std::uint16_t phr = 0;

    Table32(){
      data.fill(0);
    }

    std::uint16_t getIdx(std::uint64_t hashid){
      return (hist14^(hashid%16384)^phr^(phr>>14))&0x3FFF;
    }

    std::uint16_t gen_tag(std::uint64_t hashid){
      return (hist12^(hashid%8192))&0x0FFF;
    }

    std::uint16_t fetch_tag(std::uint64_t hashid){
      return data[getIdx(hashid)]>>4;
    }

    std::uint8_t get(std::uint64_t hashid){
      std::uint16_t store = fetch_tag(hashid);
      std::uint16_t real = gen_tag(hashid);
      if(store==real){
        return data[getIdx(hashid)]&0xF;
        //if((data[getIdx(hashid)] >> 3)%2){
        //  return true;
        //} else {
        //  return false;
        //}
      }
      return 0b11111111;
    }

    std::uint8_t getU(std::uint64_t hashid){
      return data[getIdx(hashid)]&0x3;
    }
    std::uint8_t getS(std::uint64_t hashid){
      return (data[getIdx(hashid)]&0xC)>>2;
    }

    void changeU(bool positive, std::uint64_t hashid){
      std::uint16_t idx = getIdx(hashid);
      std::uint8_t val = data[idx]&0x3;
      data[idx] &= ~0x3;
      data[idx] |= (positive) ? std::min(3,val+1) : std::max(0, val-1);
    }

    void changeS(bool positive, std::uint64_t hashid){
      std::uint16_t idx = getIdx(hashid);
      std::uint8_t val = data[idx]&0xC;
      data[idx] &= ~0xC;
      data[idx] |= ((positive) ? std::min(3,val+1) : std::max(0, val-1))<<2;
    }

    void histupdate(bool outcome, std::uint64_t planetid){
      hist <<= 1; hist |= outcome;
      hist12 = (hist^(hist>>12)^(hist>>24))&0xFFF;
      hist14 = (hist^(hist>>14)^(hist>>28))&0x3FFF;
      //hist11 = (hist^(hist>>11)^(hist>>22))&0xBFF;
      phr <<= 1; phr |= planetid&1;
    }

  };

  // TAGE table history 128
  struct Table128{
    // 12 bit tag, 2 bit saturator, 2 bit usefulness
    std::array<uint16_t, 4096> data;
    __uint128_t hist = 0;
    std::uint16_t hist12 = 0;
    std::uint16_t hist11 = 0;
    std::uint16_t phr = 0;

    Table128(){
      data.fill(0);
    }

    // TODO fold hashid
    std::uint16_t getIdx(std::uint64_t hashid){
      return (hist12^(hashid%4096)^phr^(phr>>12))&0x0FFF;
    }

    std::uint16_t gen_tag(std::uint64_t hashid){
      return (hist12^(hashid%4096))&0x0FFF;
    }

    std::uint16_t fetch_tag(std::uint64_t hashid){
      return data[getIdx(hashid)]>>4;
    }

    std::uint8_t get(std::uint64_t hashid){
      std::uint16_t store = fetch_tag(hashid);
      std::uint16_t real = gen_tag(hashid);
      if(store==real){
        return data[getIdx(hashid)]&0xF;
        //if((data[getIdx(hashid)] >> 3)%2){
        //  return true;
        //} else {
        //  return false;
        //}
      }
      return 0b11111111;
    }

    std::uint8_t getU(std::uint64_t hashid){
      return data[getIdx(hashid)]&0x3;
    }
    std::uint8_t getS(std::uint64_t hashid){
      return (data[getIdx(hashid)]&0xC)>>2;
    }

    void changeU(bool positive, std::uint64_t hashid){
      std::uint16_t idx = getIdx(hashid);
      std::uint8_t val = data[idx]&0x3;
      data[idx] &= ~0x3;
      data[idx] |= (positive) ? std::min(3,val+1) : std::max(0, val-1);
    }

    void changeS(bool positive, std::uint64_t hashid){
      std::uint16_t idx = getIdx(hashid);
      std::uint8_t val = data[idx]&0xC;
      data[idx] &= ~0xC;
      data[idx] |= ((positive) ? std::min(3,val+1) : std::max(0, val-1))<<2;
    }

    void histupdate(bool outcome, std::uint64_t planetid){
      hist <<= 1; hist |= outcome;
      hist12 = hist; // ~20 operations :(
      hist12 ^= hist >> 12; hist12 ^= hist >> 24; 
      hist12 ^= hist >> 36; hist12 ^= hist >> 48;
      hist12 ^= hist >> 60; hist12 ^= hist >> 72;
      hist12 ^= hist >> 84; hist12 ^= hist >> 96;
      hist12 ^= hist >> 108; hist12 ^= hist >> 120;
      hist12 &= 0xFFF;

      phr <<= 1; phr |= planetid&1;
    }
  };

  struct TAGE {
    std::uint64_t h = 0;
    __uint128_t hist = 0;
    Bimodal<16384> bank0;
    Table8 bank1; 
    Table32 bank2;
    Table128 bank3;
    bool mypred = false; // actual prediction given
    int t_pred = 0; bool pred = false;
    int t_alt = 0; bool alt = false;
    int alt_bonus = 0;

    // evaluates a saturator/confidence 4 bit group
    // for whether it should go the planet or not
    bool evalsat(std::uint8_t dat){
        if((dat >> 3)%2){
          return true;
        } else {
          return false;
        }
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      std::uint8_t b3pred = bank3.get(hashid);
      std::uint8_t b2pred = bank2.get(hashid);
      std::uint8_t b1pred = bank1.get(hashid);
      bool b0pred = bank0.get(hashid);
      std::array<std::uint8_t, 4> preds = {b0pred, b1pred, b2pred, b3pred};
      //std::cout << std::bitset<8>(b3pred) << "\t" << std::bitset<8>(b2pred) << "\t" << std::bitset<8>(b1pred) << std::endl;
      //std::cout << std::endl;

      // using if statement spaghetti because 
      // incrementing (i.e for loops) uses 3
      // points per loop
      if(b3pred != 0b11111111){
        t_pred = 3; pred = b3pred;
        if(b2pred != 0b11111111){
          t_alt = 2; alt = b2pred;
        } else if (b1pred != 0b11111111){
          t_alt = 1; alt = b1pred;
        } else {
          t_alt = 0; alt = b0pred;
        }
      } else if(b2pred != 0b11111111){
        t_pred = 2; pred = b2pred;
        if(b1pred != 0b11111111){
          t_alt = 1; alt = b1pred;
        } else {
          t_alt = 0; alt = b0pred;
        }
      } else if(b1pred != 0b11111111){
        t_pred = 1; pred = b1pred;
        t_alt = 0; alt = b0pred;
      } else {
        t_pred = t_alt = 0;
        pred = alt = b0pred;
      }

      /*
      if(b3pred != 0b11111111 or b2pred != 0b11111111 or b1pred != 0b11111111){
        std::cout << "obligatory print statement" << std::endl;
      }
      */

      // TODO what on earth did i write last night
      // this code doesn't get the MSB of the prediction, t_pred is just
      // the table id omds
      if((preds[t_pred]>>1)%2 or alt_bonus < 8){
        return mypred = evalsat(pred);
      } return mypred = evalsat(alt);
    }

    void changeU(int table, bool positive, std::uint64_t hashid){
      switch(table){
        case 1:
          bank1.changeU(positive, hashid);
          break;
        case 2:
          bank2.changeU(positive, hashid);
          break;
        case 3:
          bank3.changeU(positive, hashid);
          break;
      }
    }

    void changeS(int table, bool positive, std::uint64_t hashid){
      switch(table){
        case 1:
          bank1.changeS(positive, hashid);
          break;
        case 2:
          bank2.changeS(positive, hashid);
          break;
        case 3:
          bank3.changeS(positive, hashid);
          break;
      }
    }

    std::uint8_t getU(int table, std::uint64_t hashid){
      switch(table){
        case 1:
          return bank1.getU(hashid);
        case 2:
          return bank2.getU(hashid);
        case 3:
          return bank3.getU(hashid);
      }
      return 0;
    }

    std::uint8_t getS(int table, std::uint64_t hashid){
      switch(table){
        case 1:
          return bank1.getS(hashid);
        case 2:
          return bank2.getS(hashid);
        case 3:
          return bank3.getS(hashid);
      }
      return 0;
    }

    void allocate(int table, std::uint64_t hashid, std::uint16_t val){
      switch(table){
        case 1:
          bank1.data[bank1.getIdx(hashid)] = val;
          break;
        case 2:
          bank2.data[bank2.getIdx(hashid)] = val;
          break;
        case 3:
          bank3.data[bank3.getIdx(hashid)] = val;
          break;
      }
    }

    void update(std::uint64_t planetid, bool outcome){
      pred = evalsat(pred);
      alt = evalsat(alt);
      bool newalloc = false;
      bool usefulfound = false;
    

      // basic update policy
      if(t_pred > 0){
        if(mypred != alt){
          changeU(t_pred, mypred==outcome, h);
        }
        
        changeS(t_pred, outcome, h);
      } else {
        bank0.update(outcome);
      }

      // allocation code
      if(t_pred > 0) {
        // TODO change getS if i decide to allocate the saturator
        // with a value OTHER than zero
        if(getU(t_pred, h) == 0 and getS(t_pred,h)==0) {
          newalloc = true;

          if(pred != alt) {
            if(alt==outcome) {
              alt_bonus = std::clamp(alt_bonus+1, 0, 15);
            } else alt_bonus = std::clamp(alt_bonus-1, 0, 15);
          }
        }
      }

      if(!newalloc or (newalloc and pred != outcome)){
        if((mypred != outcome) & (t_pred < 3)){
          for(int i = t_pred+1; i<4; i++){
            if(getU(i, h) != 0){
              usefulfound = true;
              break;
            }
          }

          if(not usefulfound){
            for(int i = t_pred+1; i<4; i++){
              changeU(i, false, h);
            }
          } else {
            int rnd = rand() % 100;
            int cnt = 0;
            int bank = 0;
            std::array<int,3> banks = {-1,-1,-1};
            for(int i = t_pred+1; i<4; i++){
              if(getU(i, h)==0){
                cnt++;
                banks[i] = i;
              }
            }

            if(cnt==1){
              bank = banks[0];
            } else if(cnt>1){
              if(rnd > 33 and rnd <= 99){
                bank = banks[cnt-1];
              } else {
                bank = banks[cnt-2];
              }
            }

            for(int i = bank; i < 4; i++){
              if(getU(i, h)==0){
                allocate(i, h, 0x8);
                break;
              }
            }

          }
        }
      }

      hist <<= 1; hist |= outcome;
      bank3.histupdate(outcome, planetid);
      bank2.histupdate(outcome, planetid);
      bank1.histupdate(outcome, planetid);
      t_pred = t_alt = 0;
      pred = alt = false;
    }
  };

  // implement GHare with 8 bit history
  struct GShare {
    // a bimodal predictor for every 16 bit combo
    Bimodal<65536> data;
    __uint128_t hist = 0;
    std::uint64_t h = 0;

    GShare(){
    }

    bool get(std::uint64_t hashid){
      //h = (hashid^(hashid>>8)^hist)&0xFF;
      h = hashid;
      std::uint16_t idx = h^hist^(hist>>16)^(hist>>32)^(hist>>48)^(hist>>64)^(hist>>80)^(hist>>96)^(hist>>112);
      return data.get(idx);
    }

    void update(bool outcome, bool pred){
      hist <<= 1; hist |= outcome;
      data.update(outcome);
    }
  };


  // implement local predictor
  struct Local{
    // a bimodal predictor for every 4 bit combo
    Bimodal<16> bim;
    // 16 bits local history 
    std::array<std::uint8_t, 16384> data;
    std::uint64_t h = 0; // stored to avoid calling hash() twice

    Local(){
      data.fill(0);
    }

    bool get(std::uint64_t hashid){
      h = hashid;
      return bim.get(data[h]&0xF);
    }

    void update(bool outcome, bool pred){
      data[h] <<= 1; data[h] |= outcome;
      bim.update(outcome);
    }
  };

